import React from 'react';

const Profile = () => {
    return (
        <div className="content">
            <div className="profile__top-img">
                <img src="https://avatars.dzeninfra.ru/get-zen_doc/196027/pub_5cb2e7b9c07b6700b34e992c_5cb2ebb66749e800b419fc58/scale_2400"/>
            </div>
            <></>
            <div className="profile__avatar">
                <img src="./img/tree_and_birds.png" />
            </div>
            <div>new post form</div>
            <div>posts</div>
            <div></div>
            <div></div>
        </div>
    );
}

export default Profile;
